def get_gparams(curdate, spread=0.0):

	max_avail_date = data.loc[data[u'Date'] <= curdate, u'Date'].max()

	row = data.loc[data[u'Date']==max_avail_date, :]
	if len(row) > 0:

		res = {
			"ID": 0,
			"Date": "%s" % numpy.datetime64(row.values[0, 1], 'D'),
			"B0": row.values[0, 2] + spread,
			"B1": row.values[0, 3],
			"B2": row.values[0, 4],
			"TAU": row.values[0, 5],
			"G1": row.values[0, 6],
			"G2": row.values[0, 7],
			"G3": row.values[0, 8],
			"G4": row.values[0, 9],
			"G5": row.values[0, 10],
			"G6": row.values[0, 11],
			"G7": row.values[0, 12],
			"G8": row.values[0, 13],
			"G9": row.values[0, 14]
		}
	else:
		res = None

	return res
